import OverHeadBar from "./OverHeadBar";
import IconBar from "./IconBar";

class ShoppingCartPage extends Component {
    componentDidMount() {

    }

    render() {
        return (
            <div>
                <OverHeadBar currentPage='CART'/>
                <IconBar />
            </div>
        );
    }
}

export default ShoppingCartPage;
